import React from "react";
import { useNavigate } from "react-router-dom";

const DetailsPage = () => {
  const navigate = useNavigate();
  return (
    <>
      <h1>Details Page</h1>
      <button onClick={() => navigate(-1)}>Go Back Home</button>
    </>
  );
};

export default DetailsPage;
